import Map from "../components/Map";
import "./Leaflet.css";
import InputForm from "../components/InputForm";

const Buses = () => {
  return (
    <div>
      <h1>Bus routes Page</h1>
      <br></br><br></br>
      <div>
      <InputForm />
      <br></br><br></br>
      <Map />
      </div>
        
    </div>
  );
};

export default Buses;
